import React from 'react';

const AdditionalInformation = () => {
  return (
    <section className='additional-information'>
      <div className="container">
        <div className="inner">
            <div className="paragraph">
                <h2 className="title h2-text">
                    Casino NB Poker and Other Games Available to Play
                </h2>
                <p>
                    If you come to Casino NB events and want to enjoy gambling, 
                    you have chosen a great place. There is a wide range 
                    of different entertainment options that will appeal to everyone. 
                    You can try your hand at different tables and slot machines. Or take 
                    part in one of the regular tournaments with big prize winnings.
                </p>
            </div>
        </div>
      </div>
    </section>
  );
};

export default AdditionalInformation;
